import React, { Component } from 'react'

export default class ListDerangemet extends Component{
    constructor(props)
    {
        super(props)
        this.state={
            listDer:[]
        }
    }
    componentDidMount()
    {
       this.getAttente()
    }

    getAttente=()=>{
        fetch('http://localhost:5000/derangement/afficherAttente/web/'+this.props.location.state.service, {
            method: 'GET',
            headers: {
              'Content-Type': 'application/json',
            },
          })
            .then((response) => response.json())
            .then((responseJson) => {
                this.setState({listDer:responseJson},()=>console.log(this.state.listDer))
             
            });
    }
  render()
  {
      return(
        <div>
         <div style={{backgroundColor:"red", height:"100%",width:"80%"}}></div>
        </div>
      )
  }
};
